import React from 'react'
import { Card } from 'react-bootstrap'
function AwardCard(p) {
    return (
        <>

        <div className="col-md-3 expcard" >
        <Card className="card" style={{height:"220px"}} >
            <Card.Body>
                <p className="text-center">{p.date}</p>
               <img src={p.imgsrc} alt="" srcset="" />


                <Card.Text className="text-center">
                    {p.para}
                </Card.Text>

            </Card.Body>
        </Card>

    </div>


        </>
    )
}

export default AwardCard;
